void MENU_add_virus(uint8_t level){

	static XY_position_t pos = {0};
	static uint32_t position = 0;
	level*=2;
	for(uint8_t i = 0;i != level; i++){
		pos = MENU_get_virus_position();
		if (CHECK_PILLS[((9*(pos.x-1)))+(pos.y-1)] == 4){
			for(uint8_t i = 0; i != 8; i++){
				position = (((84*pos.x)+4)+(8*(pos.y-1)))+i;
				CURRENT_GAME[position] = white_v[i];
			}
		}else if (CHECK_PILLS[((9*(pos.x-1)))+(pos.y-1)] == 5){
			for(uint8_t i = 0; i != 8; i++){
				position = (((84*pos.x)+4)+(8*(pos.y-1)))+i;
				CURRENT_GAME[position] = black_v[i];
			}
		}else{
			for(uint8_t i = 0; i != 8; i++){
				position = (((84*pos.x)+4)+(8*(pos.y-1)))+i;
				CURRENT_GAME[position] = line_v[i];
			}
		}
	}
	LCD_nokia_bitmap(CURRENT_GAME,LCD_game);

}

XY_position_t MENU_get_virus_position(void){

	static uint8_t x = 0;
	static uint8_t y_1 = 0;
	static uint8_t y_2 = 0;
	static uint8_t virus = 0;

	XY_position_t position = {0};
	while(1){

		RNGA_GetRandomData(RNG, &x, 1);
		x &= ~(0xFC);
		x++;
		RNGA_GetRandomData(RNG, &y_1, 1);
		y_1 &= ~(0xFC);
		RNGA_GetRandomData(RNG, &y_2, 1);
		y_2 &= ~(0xFE);

		position.x = x;
		position.y = y_1+y_2;
		if(position.y == 0){
			position.y++;
		}
		if(CHECK_PILLS[((9*(position.x-1)))+(position.y-1)]== 0x00){
			RNGA_GetRandomData(RNG, &virus, 1);
			virus &= ~(0xF8);
			MENU_track_virus(((9*(position.x-1)))+(position.y-1), virus);
			break;
		}
	}
	return position;
}


void MENU_add_pill(void){

	static uint32_t left_position = 0;
	static uint32_t right_position = 0;

	x_pill = 2;
	y_pill = 10;
	flip_count = 0;

	left_position = (((84*x_pill)+4)+(8*(y_pill-1)));
	right_position = (((84*(x_pill+1))+4)+(8*(y_pill-1)));

	RNGA_GetRandomData(RNG, &left, 1);
	left &= ~(0xF8);
	RNGA_GetRandomData(RNG, &right, 1);
	right &= ~(0xF8);

	if(CURRENT_GAME[left_position] != 0x00){
		MENU_game_reset();
		PIT_StopTimer(PIT, kPIT_Chnl_1);
		MENU_print_game_over();
		DMA_config(GameOver, 27328, DMA_OneTransfer);
		current_state = set_level;
		count_level = 1;
		count_speed = 0;
		flag_g  = 0;
		return;
	}
	for(uint8_t i = 0; i != 8; i++){

		MENU_add_left(left_position, left, i);
		MENU_add_right(right_position, right, i);

		left_position++;
		right_position++;
	}
	LCD_nokia_bitmap(CURRENT_GAME,LCD_game);
}
void MENU_down_pill(void){
	y_pill--;
	if (y_pill == 0){
		y_pill++;
		MENU_check_pill();
		MENU_add_pill();
		return;
	}
	static uint32_t left_position = 0;
	static uint32_t right_position = 0;
	static uint32_t up_position = 0;
	static uint32_t down_position = 0;
	static uint32_t last_1_position = 0;
	static uint32_t last_2_position = 0;
	if (flip_count % 2 == 0){
		left_position 		= (((84*x_pill)+4)+(8*(y_pill-1)));
		right_position 		= (((84*(x_pill+1))+4)+(8*(y_pill-1)));
		last_1_position 		= left_position+8;
		last_2_position 		= right_position+8;

		if(CURRENT_GAME[left_position] != 0x00 || CURRENT_GAME[right_position] != 0x00){
			y_pill++;
			MENU_check_pill();
			MENU_add_pill();
			return;
		}

	}else{
		up_position		 	= (((84*x_pill)+4)+(8*(y_pill)));
		down_position 		= (((84*x_pill)+4)+(8*(y_pill-1)));
		last_1_position 		= up_position+8;
		if(CURRENT_GAME[down_position] != 0x00){
			y_pill++;
			MENU_check_pill();
			MENU_add_pill();
			return;
		}
	}

	for(uint8_t i = 0; i != 8; i++){
		if (flip_count % 2 == 0){
			MENU_add_left(left_position, left, i);
			MENU_add_right(right_position, right, i);
			MENU_clean_pill(last_1_position);
			MENU_clean_pill(last_2_position);
			left_position++;
			right_position++;
		}else{
			MENU_add_up(up_position, up, i);
			MENU_add_down(down_position, down, i);
			MENU_clean_pill(last_1_position);
			up_position++;
			down_position++;
		}
		last_1_position++;
		last_2_position++;
	}
	LCD_nokia_bitmap(CURRENT_GAME,LCD_game);

}
