void MENU_SetLevel(void){

	if(GPIO_Get_irq_status(GPIO_D)){
		if(count_level < 5){
			count_level++;
		}
		else{
			count_level = count_level;
		}
	}
	else if(GPIO_Get_irq_status(GPIO_C)){
		if(count_level > 1){
			count_level--;
		}
		else{
			count_level = count_level;
		}
	}
	MENU_PrintLevel(count_level);
	level = count_level;
}

