void MENU_state_machine(void){

	if(!flag_g){
		MENU_change_state();
		switch (current_state){
		case set_level:
			if(GPIO_Get_irq_status(GPIO_C)||GPIO_Get_irq_status(GPIO_D)){
				MENU_SetLevel();
				GPIO_Clear_irq_status(GPIO_C);
				GPIO_Clear_irq_status(GPIO_D);
			}
			break;
		case set_speed:
			if(GPIO_Get_irq_status(GPIO_C)||GPIO_Get_irq_status(GPIO_D)){
				MENU_SetSpeed();
				GPIO_Clear_irq_status(GPIO_C);
				GPIO_Clear_irq_status(GPIO_D);
			}
			break;
		case game:
			flag_g = true;
			MENU_game_reset();
			LCD_nokia_clear(LCD_game);
			LCD_nokia_bitmap(CURRENT_GAME,LCD_game);
			MENU_startGame();
			MENU_game_settings();
			PIT_StopTimer(PIT, kPIT_Chnl_1);
			PIT_SetTimerPeriod(PIT, kPIT_Chnl_1, USEC_TO_COUNT(PIT1_TIME, PITclock));
			PIT_StartTimer(PIT, kPIT_Chnl_1);
			DMA_config(sound, 51208, DMA_ContinuosTransfer);
			GPIO_Clear_irq_status(GPIO_B);
			break;
		}
	}
}

void MENU_change_state(void){

	if(GPIO_Get_irq_status(GPIO_A) && current_state != game){

		if(set_level == current_state){
			current_state = set_speed;
		}
		else if(set_speed == current_state){
			current_state = game;
		}
		GPIO_Clear_irq_status(GPIO_A);
	}
}

uint8_t MENU_return_flag(void){
	return flag_g;
}
